import React from "react";
import transition from "../transition";
import { useEffect , useRef } from "react";

const Eventpage = () => {
  const mainRef = useRef(null);

  useEffect(() => {
    const createDiv = () => {
      const scene = document.querySelector(".scene");
      for (let i = 0; i < 210; i++) {
        const div = document.createElement("div");
        scene.appendChild(div);
      }
    };

    createDiv();

    const setStarsProperties = () => {
      const stars = document.querySelectorAll(".scene div");
      stars.forEach((star) => {
        let x = `${Math.random() * 200}vmax`;
        let y = `${Math.random() * 100}vh`;
        let z = `${Math.random() * 200 - 100}vmin`;
        let rx = `${Math.random() * 360}deg`;
        star.style.setProperty("--x", x);
        star.style.setProperty("--y", y);
        star.style.setProperty("--z", z);
        star.style.setProperty("--rx", rx);
        let delay = `${Math.random() * 1.5}s`;
        star.style.animationDelay = delay;
      });
    };

    setStarsProperties();
    setTimeout(() => {
      const mainElement = mainRef.current;
      mainElement.classList.add("blurred");
    }, 3000);
  }, []);

  return (
    <div>

      <nav className="flex text-[#fff] flex-row  items-center align-middle mx-auto pl-10 justify-between .nav-bar" style={{ position: "absolute", top: 0, left: 0, right: 0, zIndex: 1 }}>
          <a href="" className="font-varino">
            Contact
          </a>
          <svg
            width="34"
            height="34"
            viewBox="0 0 34 34"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <g id="Huge-icon/arrows/outline/arrow-down">
              <path
                id="Vector 190"
                d="M21.2722 18.4141V12.7573M21.2722 12.7573H15.6153M21.2722 12.7573L12.7869 21.2425"
                stroke="#F3F3F3"
                stroke-width="1.5"
                stroke-linecap="round"
                stroke-linejoin="round"
              />
            </g>
          </svg>
          <a href="" className="font-varino ml-3">
            About
          </a>
          <svg
            width="34"
            height="34"
            viewBox="0 0 34 34"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <g id="Huge-icon/arrows/outline/arrow-down">
              <path
                id="Vector 190"
                d="M21.2722 18.4141V12.7573M21.2722 12.7573H15.6153M21.2722 12.7573L12.7869 21.2425"
                stroke="#F3F3F3"
                stroke-width="1.5"
                stroke-linecap="round"
                stroke-linejoin="round"
              />
            </g>
          </svg>
          <h1 className="font-varino font-bold mx-auto tracking-wide">ZIEGERS</h1>
          <a href="">
            <div className="w-[187px] h-[60px] pl-[21.06px] pr-[12.94px] bg-sky-600 rounded-full shadow border border-sky-600 justify-end items-center gap-1.5 inline-flex">
              <div className="w-4 h-4 justify-center items-center inline-flex">
                <div className="w-4 h-4 relative flex-col justify-start items-start flex" />
              </div>
              {/* <div className="text-center text-zinc-100 text-xs font-normal font-['Varino']">
                <h1>Instagram
                  </h1>
              </div> */}
            </div>
          </a>
        </nav>

      <main ref={mainRef} className="scene main-container" style={{ position: "relative", zIndex: 0 }}>
       
      </main>
    </div>
  );
};

export default transition(Eventpage);
